import React, { Component } from 'react'
import './Navbar.css'
import { NavLink } from 'react-router-dom'


class Navbar extends Component {
    state = {  }
    render() {
        return (
            <>
             <header id="nav-wrapper">
                <nav id="nav">
                <NavLink>   
                <div class="nav left">
                    <span class="gradient skew">
                    <NavLink to='/'> <h1 class="logo un-skew">WODSHARE</h1> </NavLink>

                    </span>
                    {/* <button id="menu" class="btn-nav"><span class="fas fa-bars"></span></button> */}
                </div>
                </NavLink>
                <div class="nav right">
                    <NavLink className="nav-link " to="/"><span class="nav-link-span"><span class="u-nav">Home</span></span></NavLink>
                    <NavLink className="nav-link " to="/login"><span class="nav-link-span"><span class="u-nav">Login/Sign Up</span></span></NavLink>
                    {/* <a href="#about" class="nav-link"><span class="nav-link-span"><span class="u-nav">Login/Sign Up</span></span></a> */}
                    <a href="#work" class="nav-link"><span class="nav-link-span"><span class="u-nav">Work</span></span></a>
                    <a href="#contact" class="nav-link"><span class="nav-link-span"><span class="u-nav">Contact</span></span></a>
                </div>
                </nav>
            </header>
            </>
        );
    }
}

export default Navbar;
